import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class FAQ extends Component {
  question_and_answer = [
    {
      id: 1,
      question: "What?",
      answer: "Hello World"
    },
    {
      id: 2,
      question: "What kinds of dogs are there?",
      answer: "Hello World"
    },
    {
      id: 3,
      question: "How do you acquire a dog?",
      answer: "Hello World"
    }
  ];

  state = {
    isToggle: true
  };

  isToggle = () => {
    this.setState({ isToggle: !this.state.isToggle });
  };

  fn_question_and_answer = () => {
    return (
      <React.Fragment>
        <div className="active title">Hello World</div>
        <div className="active content">
          <p>This is test</p>
        </div>
      </React.Fragment>
    );
  };
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="ui text container">
          <center>
            <h1 className="warranty">FAQ</h1>
            <br />
          </center>
          <div className="ui accordion">
            {this.question_and_answer.map(data => {
              return this.fn_question_and_answer();
            })}
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default FAQ;
